def main():
  from builtins import int

  from sys import stdin
  input = stdin.readline

  N = int(input())
  S = list(input()[:-1])
  S1 = S[:N]
  S2 = S[N:]
  Q = int(input())

  for _ in [0] * Q:
    tab = input()
    if tab[0] == '2':
      S1, S2 = S2, S1
    else:
      tab = tab.split()
      a_index = int(tab[1]) - 1
      b_index = int(tab[2]) - 1

      if b_index < N:
        S1[a_index], S1[b_index] = S1[b_index], S1[a_index]
      elif a_index >= N:
        a_index -= N
        b_index -= N
        S2[a_index], S2[b_index] = S2[b_index], S2[a_index]
      else:
        b_index -= N
        S1[a_index], S2[b_index] = S2[b_index], S1[a_index]

  print(''.join(S1 + S2))

main()

